insert into Video values (39,'Altered Carbon','1',1,'Takeshi Kovacs est un ancien soldat et seul survivant d’un groupe de guerriers d élite vaincus lors d’un soulèvement contre le nouvel ordre mondial. Son esprit est emprisonné dans la glace pendant des siècles, jusqu’à ce que Laurens Bancroft, un homme extrêmement riche et vivant depuis plusieurs siècles lui offre la chance de vivre à nouveau. En échange, Kovacs doit résoudre un meurtre ... celui de Bancroft lui-même.',50,100, 2.99,3.99);
