insert into Video values (97,'Systeme Solaire, Incroyable Histoire','',0,'La nature même de notre Terre est un véritable miracle, et ce qui reste encore l un des plus grands mystères de l astronomie commence, peu à peu, à se dévoiler... C est un fait : grâce à des preuves venues de planètes extérieures à notre système solaire, les astronomes écrivent une nouvelle histoire de notre univers, un véritable conte infernal, rythmé par le chaos et le tumulte... Car le chemin fut long et mouvementé pour que nos planètes se stabilisent à la place qu elles occupent aujourd hui dans l environnement de notre Terre, permettant à la vie d y éclore.',100,100, 3.99,8.99);
insert into Video values (98,'Prise d otages du vol Alger-Paris','',0,'En 1994, la veille de Noël, un Airbus transportant 177 passagers et 15 tonnes de kérosène extrêmement inflammable explose au-dessus de Paris : une pluie de débris incandescents s abat sur la Ville Lumière. Ce scénario catastrophe... ne s est jamais produit, car les quatre terroristes algériens qui ont détourné le vol Air France 8969 n ont heureusement pas pu le mener à son terme.',100,100, 3.99,8.99);
insert into Video values (99,'Horizon Pacifique','',0,'A première vue, Loretta est une femme polynésienne comme beaucoup d autres. Sa maison, les courses au magasin, le jardin, les chiens accaparent une partie de son temps. Mais une toute petite partie seulement, car vous la trouverez plus souvent une gaffe, des hameçons ou un couteau à la main, vêtue d un gros ciré et de bottes en caoutchouc plutôt que d un pareo et d escarpins, pataugeant dans l eau salé, le sang de poissons du large ou la glace pilée. Partons à la rencontre de Loretta, la seule femme polynésienne embarquée sur un palangrier et qui fait mentir la sacro-sainte règle de tout marin pêcheur : «Pas de femme à bord !»',100,100, 3.99,8.99);
insert into Video values (100,'L homme sur Mars','',0,'A première vue, Loretta est une femme polynésienne comme beaucoup d autres. Sa maison, les courses au magasin, le jardin, les chiens accaparent une partie de son temps. Mais une toute petite partie seulement, car vous la trouverez plus souvent une gaffe, des hameçons ou un couteau à la main, vêtue d un gros ciré et de bottes en caoutchouc plutôt que d un pareo et d escarpins, pataugeant dans l eau salé, le sang de poissons du large ou la glace pilée. Partons à la rencontre de Loretta, la seule femme polynésienne embarquée sur un palangrier et qui fait mentir la sacro-sainte règle de tout marin pêcheur : «Pas de femme à bord !»',100,100, 3.99,8.99);
